import axios from 'axios';

const MAIN_API_BASE_URL = "http://localhost:8080/api";

class MainService {


    startNewGame(){
        return axios.get(MAIN_API_BASE_URL + "/newgame")
    }

    getGameIds(){
        return axios.get(MAIN_API_BASE_URL + "/gameids")
    }
}

export default new MainService()
